import axios from "axios";

class MetaWeather {
  constructor() {
    this.state = {
      woeid: null
    };
  }

  getLocation = async query => {
    // let res = await axios.get(`https://www.metaweather.com/api/location/search/?query=${query}`)

    fetch('http://jsonplaceholder.typicode.com/users')
    .then(res => res.json())
    .then((data) => {
      console.log(data);
    })
    .catch(console.log)
    // console.log(res);
  };
}
const MW = new MetaWeather();
export {MW as MetaWeather};
